#
# TABLE STRUCTURE FOR: earthworks
#

DROP TABLE IF EXISTS `earthworks`;

CREATE TABLE `earthworks` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `organization_executor_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на организацию, выполняющую работы',
  `address` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес выполнения работ',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание',
  `start_date` date DEFAULT (CURRENT_DATE) COMMENT 'Дата начала выполнения работ',
  `end_date` date DEFAULT NULL COMMENT 'Планируемая дата решения проблемы',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Земляные работы';



#
# TABLE STRUCTURE FOR: organizations
#

DROP TABLE IF EXISTS `organizations`;

CREATE TABLE `organizations` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название организации',
  `address` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Описание и общая информация по желанию',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=121 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Организации';



#
# TABLE STRUCTURE FOR: problems
#

DROP TABLE IF EXISTS `problems`;

CREATE TABLE `problems` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `problem_type_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на тип проблемы',
  `address` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес проблемы',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание проблемы',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя-создателя записи',
  `filename` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Путь к файлу',
  `problem_status_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на текущий статус проблемы',
  `responsible_person_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя, ответственного за решение проблемы',
  `scheduled_at` date DEFAULT NULL COMMENT 'Планируемая дата решения проблемы',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1231 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Проблемы';



#
# TABLE STRUCTURE FOR: problems_statuses
#

DROP TABLE IF EXISTS `problems_statuses`;

CREATE TABLE `problems_statuses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название статуса',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Статусы проблем';



#
# TABLE STRUCTURE FOR: problems_types
#

DROP TABLE IF EXISTS `problems_types`;

CREATE TABLE `problems_types` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название статуса',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Статусы проблем';



#
# TABLE STRUCTURE FOR: traffic_accident
#

DROP TABLE IF EXISTS `traffic_accident`;

CREATE TABLE `traffic_accident` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `address` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес места ДТП',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание',
  `is_traffic_blocked` tinyint(1) DEFAULT NULL COMMENT 'Признак блокировки движения',
  `filename` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Путь к файлу',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='ДТП';



#
# TABLE STRUCTURE FOR: user_statuses
#

DROP TABLE IF EXISTS `user_statuses`;

CREATE TABLE `user_statuses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название статуса',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Статусы пользователей';



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `first_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `last_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон',
  `address` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Адрес',
  `user_status_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на статус пользователя',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Пользователи';



#
# TABLE STRUCTURE FOR: weather_data
#

DROP TABLE IF EXISTS `weather_data`;

CREATE TABLE `weather_data` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `day_of_measurement` date DEFAULT (CURRENT_DATE) COMMENT 'Дата',
  `time_of_measurement` time DEFAULT (CURRENT_TIME) COMMENT 'Время',
  `air_temperature` decimal(3,1) NOT NULL COMMENT 'температура воздуха',
  `atmospheric_pressure` int(10) unsigned NOT NULL COMMENT 'Атмосферное давление',
  `humidity` int(10) unsigned NOT NULL COMMENT 'Влажность воздуха',
  `wind_speed` decimal(4,1) NOT NULL COMMENT 'Скорость ветра',
  `wind_direction_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на направление ветра',
  `radiation` int(10) unsigned NOT NULL COMMENT 'Уровень радиации',
  `water_level` int(10) unsigned NOT NULL COMMENT 'Уровень воды',
  `light_level` int(10) unsigned NOT NULL COMMENT 'Уровень освещенности',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Метеоданные';



#
# TABLE STRUCTURE FOR: wind_direction
#

DROP TABLE IF EXISTS `wind_direction`;

CREATE TABLE `wind_direction` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `direction` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Направление ветра',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Роза ветров';



